        this.state = {
            name: "User"
        }

    }
    displayWelcome=(props) =>{
        <h3>    HELLO {this.state.name}</h3>
    }
    render(){
        return(

         <input type="text" placeholder="Enter your name" className="personalinput" ></input>

        );
    }

}

export default InputPage;
